import "./App.css";
import HomePage from "./Homepage/Homepage";
import Calendar from "./Calendar/Calendar";
import { Component } from "react";

const style = {
  position: "relative",
  margin: "50px auto",
};

class App extends Component {
  render() {
    return (
      <div className="App">
        <HomePage></HomePage>
        <Calendar />
      </div>
    );
  }
}

export default App;
